  "description": "<p><span style=\"font-weight: 400;\">Do you often wonder, \"</span><i><span style=\"font-weight: 400;\">Is my dog getting enough nutrition from their food? </span></i><span style=\"font-weight: 400;\">We are here to take that worry off your plate. </span></p>\n<p><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Introducing Sara's Wholesome Food - all natural, <b data-mce-fragment=\"1\"><i data-mce-fragment=\"1\">ready to eat</i></b> meals made using fresh, human grade ingredients. This grain free recipe is ideal for dogs with allergies, sensitivities or those who have difficulty digesting grains. Prepared in our state of the art kitchen by canine nutritionists, this meal serves as a balanced diet for dogs of all ages. Every ingredient is purposefully hand picked and slow-cooked with care to meet your dog's daily nutritional needs .<strong data-mce-fragment=\"1\"><span data-sheets-value='{\"1\":2,\"2\":\"HUFT Sara' data-sheets-userformat='{\"2\":513,\"3\":{\"1\":0},\"12\":0}' data-mce-fragment=\"1\" s=\"\" wholesome=\"\" food=\"\" classic=\"\" chicken=\"\" and=\"\" brown=\"\" rice=\"\" dog=\"\" wet=\"\" sara=\"\" paneer=\"\" eggs=\"\" grain-free=\"\" turkey=\"\" lamb=\"\" apple=\"\"><a href=\"https://headsupfortails.com/pages/sara-wholesome-food\" title=\"Wholesome Food\" data-mce-fragment=\"1\" data-mce-href=\"https://headsupfortails.com/pages/sara-wholesome-food\">Read more from here</a></span></strong> </span></p>\n<p><strong><i>With this super value pack of 7, stay stress free about your dog's next meal. </i><i>Easy on the pocket, loaded with nutrition and made with the same care as you.</i></strong></p>\n<p><b>WHAT YOU SEE IS WHAT YOU GET</b></p>\n<p><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">     Lamb  I  Apple  I  Mackerel Fish  I  Pumpkin I  Spinach  I  Carrot  I  and more</span></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Made using the choicest &amp; freshest of ingredients</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">50% Meat, 50% Fruits, Vegetables &amp; Supplements</span></li>\n</ul>\n<p><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><b>WHAT YOU PUT IN THEIR BOWL MATTERS </b></span></p>\n<table>\n<tbody>\n<tr>\n<td>\n<p><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Formulated by </span><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><br></span><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Canine Nutritionists</span></p>\n</td>\n<td>\n<p><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Purposeful, visible ingredients</span></p>\n</td>\n<td>\n<p><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">No added preservatives or fillers</span></p>\n</td>\n</tr>\n</tbody>\n</table>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Optimal Protein for growth &amp; healthy living.</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Essential fatty acids and micronutrients help build immunity.</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Loaded with antioxidants that help prevent diseases.</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Aids in weight management.</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Omega 3 fatty acids help reduce inflammation.</span></li>\n</ul>\n<p><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><b>WHAT MAKES SARA's FOOD FRESH?</b></span></p>\n<p><span style=\"font-weight: 400;\">Locally sourced, farm fresh ingredients arrive at our state of the art kitchen.</span></p>\n<p><span style=\"font-weight: 400;\">                                                        <span data-mce-fragment=\"1\">:</span></span></p>\n<p><span style=\"font-weight: 400;\">These purposeful ingredients are slow cooked in small batches to retain maximum nutrients.</span></p>\n<p><span style=\"font-weight: 400;\">                                                        <span data-mce-fragment=\"1\">:</span></span></p>\n<p><span style=\"font-weight: 400;\">The food is packed in a retort packaging to ensure it remains fresh without the use of any preservatives or stabilisers.</span></p>\n<p><span style=\"font-weight: 400;\">                                                        <span data-mce-fragment=\"1\">:</span></span></p>\n<p><span style=\"font-weight: 400;\">The result is a wholesome &amp; nutritious bowl of food for your pet to enjoy.</span></p>\n<p><b>We are taking on the responsibility of cooking complete, balanced meals for your pets. </b></p>\n<p><span style=\"font-weight: 400;\">Serve this simple recipe of love with great ease and convenience.</span></p>\n<p><span style=\"font-weight: 400;\">All the meals are ready to eat. </span><i><span style=\"font-weight: 400;\">Just cut, open &amp; serve. </span></i><br></p>\n<p><i><span style=\"font-weight: 400;\">Once opened, refrigerate and consume within 48 hours. Store in a clean and dry place, away from direct sunlight.</span></i></p>\n<p><b>Feeding Guidelines:</b></p>\n<ul>\n<li>\n<span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Up to</span> <span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">8kg: half pack/day</span>\n</li>\n<li><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">8-15 kg: 1 pack/day</span></li>\n<li><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">15-25 kg: 2 packs/day</span></li>\n<li><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">25-35 kg: 2.5 to 3 packs/day</span></li>\n</ul>\n<p><b>Wholesome Wisdom: <i data-mce-fragment=\"1\"><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">Dogs love a routine, and this stands true even for their meal times. By sticking to a fixed time, you can avoid overfeeding in-between meals, and your dog will also look forward to their meal time.</span></i></b></p>\n<p><b><i data-mce-fragment=\"1\"><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\"><strong>Note:</strong> For Free Product please add <strong><a href=\"https://headsupfortails.com/products/huft-sea-breeze-perfume-for-dogs\" data-sk=\"tooltip_parent\" data-stringify-link=\"https://headsupfortails.com/products/huft-sea-breeze-perfume-for-dogs\" class=\"c-link\" delay=\"150\" target=\"_blank\">HUFT Perfume</a></strong> in your Cart.</span></i></b></p>\n<style type=\"text/css\"><!--\ntd {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}\n--></style>",
