  "description": "<p><span>Do you often wonder, </span><i><span>Is my dog getting enough nutrition from their food?</span></i></p>\n<p><span>We are here to take that worry off your plate.</span></p>\n<p><span>Introducing Sara's Wholesome Food in 100g packs for small dogs  - all natural, </span><b><i>ready to eat</i></b><span> meals made using fresh, human grade ingredients. Prepared in our state of the art kitchen by canine nutritionists, this meal serves as a balanced diet for dogs of all ages. Every ingredient is purposefully hand picked and slow cooked with care to meet your dog's daily nutritional needs.</span></p>\n<p><b>WHAT YOU SEE IS WHAT YOU GET</b></p>\n<p><span>Paneer I  Eggs  I  Green Peas  I  Beans I  Spinach  I  Apple  I   and more</span></p>\n<ul>\n<li><span>Made using the choicest &amp; freshest of ingredients</span></li>\n</ul>\n<ul>\n<li><span>35% Paneer, 65% Fruits, Vegetables &amp; Brown Rice</span></li>\n</ul>\n<p><b>WHAT YOU PUT IN THEIR BOWL MATTERS:</b></p>\n<table>\n<tbody>\n<tr>\n<td>\n<p><span>Formulated by</span><span><br></span><span>Canine Nutritionists</span></p>\n</td>\n<td>\n<p><span>Purposeful, visible ingredients</span></p>\n</td>\n<td>\n<p><span>No added preservatives or fillers</span></p>\n</td>\n</tr>\n</tbody>\n</table>\n<ul>\n<li><span>Optimal Protein for growth &amp; healthy living.</span></li>\n<li><span>Essential fatty acids and micronutrients help build immunity.</span></li>\n<li><span>Loaded with antioxidants that help prevent diseases.</span></li>\n<li><span>Aids in weight management.</span></li>\n<li><span>Omega 3 fatty acids help reduce inflammation.</span></li>\n</ul>\n<p><b>WHAT MAKES SARA'S FOOD FRESH?</b></p>\n<p><span>Locally sourced, farm fresh ingredients arrive at our state of the art kitchen.</span></p>\n<p><span>                                                            :</span></p>\n<p><span>These purposeful ingredients are slow cooked in small batches to retain maximum nutrients.</span></p>\n<p><span>                                                            :</span></p>\n<p><span>The food is packed in a retort packaging to ensure it remains fresh without the use of any preservatives or stabilisers.</span></p>\n<p><span>                                                            :</span></p>\n<p><span>The result is a wholesome &amp; nutritious bowl of food for your pet to enjoy.</span></p>\n<p><b>We are taking on the responsibility of cooking complete, balanced meals for your pets.</b></p>\n<p><span>Serve this simple recipe of love with great ease and convenience.</span></p>\n<p><span>All the meals are ready to eat. </span><i><span>Just cut, open &amp; serve.</span></i></p>\n<p><i><span>Once opened, refrigerate and consume within 48 hours. Store in a clean and dry place, away from direct sunlight.</span></i></p>\n<p><b>Feeding Guidelines:</b></p>\n<ul>\n<li><span>Up to 5 kg: 1 pack/day</span></li>\n<li><span>5-8 kg: 1.5 packs/day</span></li>\n<li><span>8-15 kg: 3 packs/day</span></li>\n</ul>\n<p><b>Wholesome Wisdom:<span> </span></b><i><span>We love sharing everything with our dogs, including our food. But before you get serenaded by their puppy eyes and wagging tail, remember to feed only what is good for them.</span></i></p>\n<p><i><span><b data-stringify-type=\"bold\">Note: </b>For Free Product please add<b data-stringify-type=\"bold\"> </b><b data-stringify-type=\"bold\"><a class=\"c-link\" data-stringify-link=\"https://headsupfortails.com/products/huft-sea-breeze-perfume-for-dogs\" data-sk=\"tooltip_parent\" href=\"https://headsupfortails.com/products/huft-sea-breeze-perfume-for-dogs\" target=\"_blank\" delay=\"150\">HUFT Perfume</a></b><b data-stringify-type=\"bold\"> </b>in your Cart.</span></i></p>\n<style type=\"text/css\"><!--\ntd {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}\n--></style>",
