  "id": 7127444848702,
  "title": "HUFT Yum Nums Soft & Chewy Sticks Banana with Real Chicken Treat For Dogs - 75g",
  "handle": "huft-yum-nums-soft-chewy-sticks-banana-with-real-chicken-treat-for-dogs-75g",
  "description": "<p><b>Soft chews that will make your dog go YUM</b></p>\n<p><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Introducing Yum Nums, HUFT's first ever soft chew treats</span></p>\n<p><span style=\"font-weight: 400;\"></span><span style=\"font-weight: 400;\">Made with only real ingredients, minimally processed, and loaded with protein, Yum Nums ticks all the right boxes. The tender and chewy texture makes for a great training treat. Break it down &amp; reward them with yumminess. Or put them in a snuffle mat, and they will be occupied for hours.</span></p>\n<p><span style=\"font-weight: 400;\">These soft chew treats will be well enjoyed by dogs of all ages &amp; breeds - but are particularly an ideal choice for teething puppies, dogs with sensitive teeth or senior dogs who have difficulty chewing.</span></p>\n<p><strong>Features:</strong></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Made with farm fresh chicken and bananas</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">High in protein</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Bananas: Improves digestive health</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Helps strengthen muscles &amp; regulates blood flow</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Cold pressed &amp; baked with love</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Gluten and grain free</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Salt and sugar free</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Contains natural preservatives</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">No artificial colors or flavors</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Suitable for all breeds of dogs and puppies over 3 months old</span></li>\n</ul>\n<p><b>Please refer to feeding guidelines to avoid overfeeding:</b></p>\n<ul>\n<li><span style=\"font-weight: 400;\">Small Breed: 1-2 sticks/day</span></li>\n<li><span style=\"font-weight: 400;\">Medium Breed: 3-4 sticks/day</span></li>\n<li><span style=\"font-weight: 400;\">Large Breed: 5-6 sticks/day</span></li>\n</ul>\n<p><b>HUFT Tip:</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Always feed treats in moderation</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Always check ingredients for possible allergens</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">We recommend pet parental supervision while feeding treats</span></li>\n</ul>\n<p><strong></strong><b>Storage: </b><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Reseal the packet tightly after opening. Once opened, consume within a week. Keep away from direct sunlight.</span></p>",
