  "description": "<p>Our dogs are descendants of wild wolves. Despite domestication, much of their biological systems and nutritional needs remain the same. So they do thrive on a carnivorous, Whole Prey diet. In the wild they would consume various parts of their prey including selected organs, feet etc.<br></p>\n<p>The True Chews is a range of limited edition, species-appropriate chews for your dogs. This variety consists only of chicken feet. Dogs enjoy the crispy texture and chomping on these strengthens their jaws. Chicken feet contain fatty acids that can contribute to a healthy, glossy coat. It also contains glucosamine and chondroitin which is great for joint health and helps to ease the pain caused by conditions like arthritis.</p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>Contains only dehydrated chicken feet (dehydrated)<br>\n</li>\n<li>Rich in glucosamine and chondroitin (excellent for joint health)</li>\n<li>Contains fatty acids for a healthy coat</li>\n<li>Supports dental hygiene</li>\n<li>Do not feed over recommended quantities</li>\n</ul>\n<p><strong>Ingredients</strong>: Chicken Feet(Dehydrated)</p>\n<p><strong>Nutritional Analysis</strong>:</p>\n<ul>\n<li>Energy: 73 kcals</li>\n<li>Protein: 6.6 g</li>\n<li>Fats: 5 g</li>\n<li>Carbohydrates: 0.1 g</li>\n</ul>\n<p><strong>Precaution: </strong>We always recommend consulting a vet before you introduce new food/chews/treats to your pet</p>\n<p><strong>Introducing True Chews to your dog: </strong>Dogs are naturally drawn to these treats but as with any new food that your pet is trying this for the first time, offer only one small piece at the beginning and wait to see how your pet reacts to it. Increase the quantities (just up to what is recommended for your dog) very gradually so his/her tummy has time to get used to it. In case of an unfavorable reaction, discontinue and check with a vet.</p>\n<p><strong>Storage</strong>: Once the pack is opened, it will last up to 1 month if refrigerated immediately.</p>",
