  "title": "HUFT Sara's Doggie Treats Chicken Jerky - 70 g",
  "handle": "saras-doggie-treats-chicken-jerky-70-g",
  "description": "<div class=\"row\">\n<div class=\"col-md-12\">\n<p>A special treat for your doggo, these bits of chicken jerky are delicious! Made from fresh ingredients these are healthy treats. Chicken is a great source of protein and a pet favorite.</p>\n<p><strong>Features</strong></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">100% natural farm-fresh and Human Grade ingredients only</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Antibiotic, Preservative &amp; Gluten-free</span></li>\n<li style=\"font-weight: 400;\">\n<b>Ingredient: </b><span style=\"font-weight: 400;\">Chicken Breast</span>\n</li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Chicken is low fat, high protein ingredient</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Turmeric is a powerful anti-oxidant, anti-inflammatory and anti-fungal</span></li>\n</ul>\n<p><strong>Feeding Guidelines:<br></strong></p>\n<ul>\n<li>Small Dogs - 2-3 piece per day</li>\n<li>Medium Dogs - 3-4 pieces per day</li>\n<li>Large Dogs - 4-5 pieces per day</li>\n</ul>\n<p><strong>Nutritional Analysis: (per 100 grams)</strong></p>\n<table width=\"420\">\n<tbody>\n<tr>\n<td width=\"147\"><strong>Energy</strong></td>\n<td width=\"273\">309.4 kcals</td>\n</tr>\n<tr>\n<td><strong>Protein</strong></td>\n<td>68.4 g</td>\n</tr>\n<tr>\n<td><strong>Total fat</strong></td>\n<td>2.89 g</td>\n</tr>\n<tr>\n<td><strong>Total carbohydrates</strong></td>\n<td>2.22 g</td>\n</tr>\n</tbody>\n</table>\n</div>\n</div>\n<div class=\"row\">\n<div class=\"col-md-12\">\n<div class=\"row\">\n<div class=\"col-md-12\">\n<div class=\"row\">\n<div class=\"col-md-12\"><br></div>\n<div class=\"col-md-12\"><br></div>\n<div class=\"col-md-12\">\n<strong>Storage: </strong>Once the pack is opened, it will last up to 1 month if refrigerated immediately</div>\n<div class=\"col-md-12\"><br></div>\n<div class=\"col-md-12\">\n<strong>HUFT Tip: </strong><span></span>These dehydrated treats are great to carry on a road trip or to the dog park. They are a convenient and healthier alternative to biscuits.<br>\n</div>\n</div>\n<div class=\"row\">\n<div class=\"col-md-12\"><br></div>\n<div class=\"col-md-12\">\n<p><span class=\"a-text-bold\">This is a range of natural, dehydrated treats made with limited, healthy ingredients. All we do is slow-cook farm-fresh, produce in small batches to retain their nutrition and flavor.</span></p>\n<p><strong>Pet parents, please note</strong></p>\n<ul>\n<li>Do not feed to pets with renal issues</li>\n<li>Always have fresh water available for your pet</li>\n<li>Never feed above recommended quantities</li>\n<li>Always check ingredients for possible allergens</li>\n</ul>\n<ul></ul>\n<p><strong>What inspired Sara's Treats?</strong></p>\n<p>Our in-house Labrador and muse, Sara simply LOVES treats. Rather than feeding her highly processed treats that offered little nutrition, we decided to come up with some minimally processed, nutrient-rich treats that could make her snack breaks healthy. And this is exactly what Sara Treats are.</p>\n</div>\n</div>\n</div>\n</div>\n<div class=\"row\">\n<div class=\"resize\">\n<div class=\"resize\">\n<ul>\n<li>These treats do not contain any preservatives or added flavors. We only include the ingredients that we have mentioned.</li>\n<li>These are healthy for your pets and provide them with a host of nutrients</li>\n</ul>\n</div>\n</div>\n</div>\n</div>\n</div>",
