  "title": "HUFT Nutri Treats For Dogs - Digestive Health - 150 g",
  "handle": "huft-nutri-treats-digestive-health-150-g",
  "description": "<p><span style=\"font-weight: 400;\">Does your dog have issues with digestion. Have you been searching for a way to keep their gut healthy.</span></p>\n<p><span style=\"font-weight: 400;\">We at HUFT are thrilled to present Nutri Treats Digestive Health - functional doggie biscuits made with 100% natural ingredients, using your dog's favourite chicken liver recipe.</span></p>\n<p><span style=\"font-weight: 400;\"><b>Why did we create Nutri Treats?</b></span></p>\n<p><span style=\"font-weight: 400;\">When it comes to our family's health, we never compromise. At Heads Up For Tails, we believe pets are family and family deserves nothing but the best. Proper nutrition can play a critical role in improving your dog's health and overall well-being. Nutri Treats is an innovative solution by our in-house scientists so your furry family member receives real nutrition with every bite.</span></p>\n<p><span style=\"font-weight: 400;\">We use only human-grade and gluten-free ingredients that are baked to perfection at our HUFT Innovation &amp; Manufacturing Centre in Bengaluru with utmost precaution and care. From the chicken liver recipe to the irresistible crunch, we have created an all-natural doggie biscuit that your pet will absolutely love.</span></p>\n<p><span style=\"font-weight: 400;\">And who says healthy treats can't be delicious? They taste so good that your dog will say - it is simply nutri-licious.</span></p>\n<p><span style=\"font-weight: 400;\"><b>Nutritional benefits of human-grade ingredients: </b></span></p>\n<ol>\n<li>\n<b>Pumpkin: </b><span style=\"font-weight: 400;\">High fibre content found in pumpkin improves digestion. Fibre can help prevent constipation and regulate bowel movement. </span>\n</li>\n<li>\n<b>Ginger: </b><span style=\"font-weight: 400;\">It helps stimulate digestive juices and eases bloating.</span>\n</li>\n<li>\n<b>Apple Cider Vinegar: </b><span style=\"font-weight: 400;\">Rich in antioxidants, it supports good gut bacteria. </span>\n</li>\n<li>\n<b></b><b>Chicken Liver: </b><span style=\"font-weight: 400;\">Excellent source of protein.</span><br>\n</li>\n</ol>\n<p><i><span style=\"font-weight: 400;\">Made in India, with love </span></i></p>\n<p><strong>Features:</strong></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Functional dog treat for digestive health</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Suitable for all dog breeds and ages</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">With goodness of pumpkin, ginger and apple cider vinegar</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">All-natural, chicken liver recipe</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Human-grade ingredients</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Slow baked to perfection</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">No wheat, no gluten</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">No corn, no soy</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">No added sugar</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">No by-products</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">No synthetic vitamins or fillers</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Comes in sweet heart shape</span></li>\n</ul>\n<p><strong>Feeding Guidelines:<br></strong></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Small breed: 2 treats/day</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Medium breed: 3-4 treats/day</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Large breed: 4-5 treats/day</span></li>\n</ul>\n<div class=\"row\">\n<div class=\"col-md-12\">\n<strong><strong></strong></strong><b>Disclaimer: </b><span style=\"font-weight: 400;\">HUFT Nutri Treats are healthy, functional dog treats, created just for your pet. They are, however, not a substitute for medicine or therapeutic supplements. We recommend consulting your veterinarian for a professional medical opinion before giving your pet any medicine.</span><br>\n</div>\n</div>\n<div class=\"row\">\n<div class=\"col-md-12\">\n<ul></ul>\n<p><b>Storage: </b><span style=\"font-weight: 400;\">Reseal the packet tightly after use. Store in a cool, dry place away from direct sunlight.</span></p>\n<p><span style=\"font-weight: 400;\"><b>HUFT Fact: </b>Nutri Treats are gently baked at lower temperatures as it helps lock in the nutrients</span></p>\n<div class=\"row\">\n<div class=\"col-md-12\">\n<p data-mce-fragment=\"1\"><b data-mce-fragment=\"1\">HUFT Tips:</b></p>\n<ul data-mce-fragment=\"1\">\n<li data-mce-fragment=\"1\"><span data-mce-fragment=\"1\">We recommend introducing any new treat to your dog slowly and gradually. Observe how your pet's body reacts to it before making the new treats a part of their daily snack-time.</span></li>\n<li data-mce-fragment=\"1\"><span data-mce-fragment=\"1\">Do not overfeed. Refer to the feeding guidelines.</span></li>\n<li data-mce-fragment=\"1\"><span data-mce-fragment=\"1\">Always check the ingredients for possible allergens.</span></li>\n<li data-mce-fragment=\"1\"><span data-mce-fragment=\"1\">We recommend pet parental supervision while feeding treats.</span></li>\n</ul>\n<br>\n<ul></ul>\n</div>\n</div>\n</div>\n</div>",
