  "description": "<p><span style=\"font-weight: 400;\">Health meets deliciousness in our Yummy In My Tummy<span> </span></span><span style=\"font-weight: 400;\">dog biscuits</span><span style=\"font-weight: 400;\">. Filled with fresh, human grade apples and cinnamon</span><span style=\"font-weight: 400;\"></span><span style=\"font-weight: 400;\">these are loaded with vitamins, antioxidants and have anti-inflammatory properties; and are perfect as treats or rewards during training. Oven-baked for easy digestion, healthy and bite-sized for convenience, these are free of artificial flavours; thus making them suitable for all dogs!</span></p>\n<p><b>Features</b><br></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Made With Real Apples &amp; Cinnamon</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Free of Artificial Flavours</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Oven-Baked For Easy Digestion</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Rich In Vitamins &amp; Antioxidants, And Consist of Anti-Inflammatory Properties</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Human Grade Ingredients </span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Suitable For Puppies Above 8 Weeks of Age</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Healthy, Delicious &amp; Safe To Eat</span></li>\n</ul>\n<p><b><i>HUFT Tip</i></b></p>\n<ul>\n<li style=\"font-weight: 400;\">\n<span style=\"font-weight: 400;\">These<span> </span></span><span style=\"font-weight: 400;\">dog treats</span><span style=\"font-weight: 400;\"><span> </span>are great for mental stimulation games! You can hide these and encourage your dog to find them, or use them in our<span> </span></span><span style=\"font-weight: 400;\">interactive dog toys</span><span style=\"font-weight: 400;\"><span> </span>like<span> </span></span><a href=\"https://headsupfortails.com/pages/search-results-page?q=snuffle+mats\" data-mce-href=\"https://headsupfortails.com/pages/search-results-page?q=snuffle+mats\"><span style=\"font-weight: 400;\">Snuffle Mats</span></a><span style=\"font-weight: 400;\"><span> </span>for more fun!</span>\n</li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Always feed your dog the recommended quantity only</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Please refer to the packaging for possible allergens</span></li>\n</ul>\n<p><b>Storage instructions</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Store in a cool, dry place away from direct sunlight</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Not to be consumed if the seal is broken</span></li>\n</ul>\n<ul></ul>\n<ul data-mce-fragment=\"1\"></ul>",
