  "id": 2246616809534,
  "title": "HUFT Sara's Doggie Treats Fruit & Veggie Trail Mix - 70 g",
  "handle": "saras-mixed-veggie-treats-yellow-pumpkin-beetroot-sweet-potato-carrot",
  "description": "<div class=\"row\">\n<div class=\"col-md-12\">\n<p><span>In addition to meat protein, doggies need the vitamins and minerals found in veggies as well. Sara's Mixed Veggie Treats are a good source of fibre, vitamin A, vitamin B6, calcium and iron among others. Farm fresh veggies are slow-cooked in small batches for hours to retain all these nutrients. They make for a healthy snack or reward for good behaviour. You could even just add a few to your </span><span>pet'</span><span>s food </span><span>bowl</span><span>.</span></p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>100% natural farm-fresh and Human Grade ingredients only</li>\n<li>Antibiotic, Preservative &amp; Gluten-free</li>\n<li>Ingredients: Beetroot, Carrot, Apple and Banana</li>\n<li>Beetroot: Contains vitamin B6 &amp; iron for metabolism, cardiovascular &amp; respiratory health.</li>\n<li>Carrot: Contains vitamin A &amp; potassium for healthy vision, muscle growth &amp; dental health.</li>\n<li>Apple: Excellent source of antioxidants &amp; fibre</li>\n<li>Banana: High in potassium, vitamin B6, vitamin C and fibre. The high fibre content can help with gastrointestinal problems.</li>\n</ul>\n</div>\n<div class=\"col-md-12\">\n<span> </span><br>\n</div>\n</div>\n<p><strong>Feeding Guidelines:<br></strong></p>\n<ul>\n<li>Small Dogs - 5-6 piece per day</li>\n<li>Medium Dogs - 7-8 pieces per day</li>\n<li>Large Dogs - 9-10 pieces per day</li>\n</ul>\n<p><strong>Nutritional Analysis: (per 100 grams)</strong></p>\n<table width=\"420\">\n<tbody>\n<tr>\n<td width=\"147\"><strong>Energy</strong></td>\n<td width=\"273\">56.26 kcals</td>\n</tr>\n<tr>\n<td><strong>Protein</strong></td>\n<td>0.975 g</td>\n</tr>\n<tr>\n<td><strong>Total fat</strong></td>\n<td>0.195 g</td>\n</tr>\n<tr>\n<td><strong>Total carbohydrates</strong></td>\n<td>13.95 g</td>\n</tr>\n<tr>\n<td><strong>Dietary fibre</strong></td>\n<td>2.65 g</td>\n</tr>\n</tbody>\n</table>\n<div class=\"col-md-12\"><br></div>\n<div class=\"col-md-12\">\n<strong>Storage: <span data-mce-fragment=\"1\"></span></strong>Once the pack is opened, it will last up to 1 month if refrigerated immediately</div>\n<div class=\"col-md-12\"><br></div>\n<div class=\"col-md-12\">\n<strong>HUFT Tip:</strong> These dehydrated treats are great to carry on a road trip or to the dog park. They are a convenient and healthier alternative to biscuits.</div>\n<div class=\"row\">\n<div class=\"col-md-12\"><br></div>\n<div class=\"col-md-12\">\n<p><span class=\"a-text-bold\">This is a range of natural, dehydrated treats made with limited, healthy ingredients. All we do is slow-cook farm-fresh, produce in small batches to retain their nutrition and flavour.</span></p>\n<p><strong><span class=\"a-text-bold\">Pet parents, please note:</span></strong><span class=\"a-text-bold\"><br></span></p>\n<ul>\n<li><span class=\"a-text-bold\">Check ingredients for possible allergens</span></li>\n<li><span class=\"a-text-bold\">Always have clean water available for your pet</span></li>\n<li><span class=\"a-text-bold\">Do not feed over recommended quantities</span></li>\n</ul>\n<p><strong>Benefits:</strong></p>\n<ul>\n<li>We use farm-fresh and Human Grade ingredients only</li>\n<li>The ingredients are chosen only for their nutritional value, so there are no filler ingredients.</li>\n<li>These treats do not contain any preservatives or added flavors. We only include the ingredients that we have mentioned.</li>\n<li>These are healthy for your pets and provide them with a host of nutrients</li>\n</ul>\n<p><strong>What inspired Sara's Treats?</strong></p>\n<p>Our in-house Labrador and muse, Sara simply LOVES treats. Rather than feeding her highly processed treats that offered little nutrition, we decided to come up with some minimally processed, nutrient-rich treats that could make her snack breaks healthy. And this is exactly what Sara Treats are.</p>\n</div>\n</div>",
