  "title": "HUFT Goat Milk Dog Cookies - Apple - 200 gm",
  "handle": "huft-goat-milk-dog-cookies-apple",
  "description": "<p><span style=\"font-weight: 400;\">Let your furry one experience the magic of goat milk cookies - a jar full of goodness and nutrition.</span></p>\n<p><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">Gluten-free and all-natural, each of these wholesome cookies uses healthy ingredients that is slow baked in small batches to retain the nutrients.</span><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\"> What makes it healthy you ask? Goat milk is high in probiotics, protein, vitamins and fibre. Apple is a superfood which has antioxidants and vitamin A and C which is great for relieving allergies and improving gut health. The cookies are also gluten-free which makes it easy to digest and suitable for all dogs. </span></p>\n<p><span style=\"font-weight: 400;\">These nutrient-rich Goat Milk Cookies also come in a reusable golden tin jar which makes it great for gifting.</span></p>\n<p><b>Storage:</b></p>\n<p><span style=\"font-weight: 400;\">Once the packet is opened, store the cookies in the airtight container. Keep away from direct sunlight.</span></p>\n<p><b>Please refer to feeding guidelines to avoid overfeeding:</b></p>\n<p>Small Breed: 1-2 cookies/day<br>Medium Breed: 3-4 cookies/day<br>Large Breed: 4-5 cookies/day</p>\n<p><b>Features:</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Nutrient-rich superfood dog treats</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Made with real apple and goat milk</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Oven-baked in small batches</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Gluten-Free</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Goat Milk: High in probiotics, protein, vitamins and fibre</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Apple: Great for relieving allergies and improving gut health</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Comes in a reusable tin jar</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Contains natural preservatives</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">No added colours</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Suitable for all breeds of dogs</span></li>\n</ul>\n<p><b>HUFT Tip:</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Always feed treats in moderation</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Always check ingredients for possible allergens</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">We recommend pet parental supervision while feeding treats</span></li>\n</ul>\n<ul></ul>\n<ul></ul>\n<ul></ul>\n<ul></ul>\n<ul data-mce-fragment=\"1\"></ul>",
