  "id": 2026654990398,
  "title": "HUFT Sara's Doggie Treats - Chicken Liver With Turmeric - 70 g",
  "handle": "huft-chicken-liver-with-turmeric-dog-treats-80-gms",
  "description": "<div class=\"row\">\n<div class=\"col-md-12\">\n<p>Chicken Liver With Turmeric doggie treats are packed with flavor from farm-fresh chicken liver. These dehydrated treats are slow-cooked at specific temperatures to retain all their nutrients. Turmeric is a powerful antioxidant, anti-inflammatory and immunomodulatory agent. These treats are rich in Vitamin A and Iron giving your dog a healthy, nutritious snack.</p>\n<p><strong>Features:</strong></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">100% natural farm-fresh and Human Grade ingredients only</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Antibiotic, Preservative &amp; Gluten-free</span></li>\n<li style=\"font-weight: 400;\">\n<b>Ingredient: </b><span style=\"font-weight: 400;\">Chicken Liver, Organic Turmeric and Cracked Peppercorns</span>\n</li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Chicken liver is an excellent source of vitamins and iron</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Turmeric has strong antioxidant, anti-inflammatory and immunomodulatory properties</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Peppercorn facilitates better absorption of curcumin present in turmeric</span></li>\n</ul>\n<p><strong>Feeding Guidelines:<br></strong></p>\n<ul>\n<li>Small Dogs - 2-3 pieces per day</li>\n<li>Medium Dogs -3-4 pieces per day</li>\n<li>Large Dogs - 4-5 pieces per day</li>\n</ul>\n<p><strong>Nutritional Analysis: (per 100 grams)</strong></p>\n<table width=\"420\">\n<tbody>\n<tr>\n<td width=\"147\"><strong>Energy</strong></td>\n<td width=\"273\">416.5 kcals</td>\n</tr>\n<tr>\n<td><strong>Protein</strong></td>\n<td>68 g</td>\n</tr>\n<tr>\n<td><strong>Total fat</strong></td>\n<td>16.8 g</td>\n</tr>\n<tr>\n<td><strong>Total carbohydrates</strong></td>\n<td>NIL</td>\n</tr>\n<tr>\n<td><strong>Saturated fat</strong></td>\n<td>5.6 g</td>\n</tr>\n</tbody>\n</table>\n<div class=\"row\">\n<div class=\"col-md-12\">\n<strong></strong><br>\n</div>\n<div class=\"col-md-12\"><strong><strong></strong></strong></div>\n</div>\n<div class=\"row\">\n<div class=\"col-md-12\"></div>\n</div>\n</div>\n</div>\n<div class=\"row\">\n<div class=\"col-md-12\">\n<p><strong><span class=\"a-text-bold\">Pet parents, please note:</span></strong><span class=\"a-text-bold\"><br></span></p>\n<ul>\n<li><span class=\"a-text-bold\">Check ingredients for possible allergens</span></li>\n<li><span class=\"a-text-bold\">Always have clean water available for your pet</span></li>\n<li><span class=\"a-text-bold\">Do not feed over recommended quantities</span></li>\n</ul>\n<ul></ul>\n<p><strong>What inspired Sara's Treats?</strong></p>\n<p>Our in-house Labrador and muse, Sara simply LOVES treats. Rather than feeding her highly processed treats that offered little nutrition, we decided to come up with some minimally processed, nutrient-rich treats that could make her snack breaks healthy. And this is exactly what Sara Treats are.</p>\n<div class=\"row\">\n<div class=\"col-md-12\">\n<strong>Storage: <span data-mce-fragment=\"1\"></span></strong>Once the pack is opened, it will last up to 1 month if refrigerated immediately</div>\n<div class=\"col-md-12\">\n<strong></strong><br>\n</div>\n<div class=\"col-md-12\">\n<strong>HUFT Tip: </strong><span></span>These dehydrated treats are great to carry on a road trip or to the dog park. They are a convenient and healthier alternative to biscuits. This is a range of natural, dehydrated treats made with limited, healthy ingredients. All we do is slow-cook farm-fresh, produce in small batches to retain their nutrition and flavor.</div>\n</div>\n</div>\n</div>",
