  "handle": "huft-yimt-egg-and-cheese-dog-biscuits",
  "description": "<p><span style=\"font-weight: 400;\">Choose HUFT Yummy In My Tummy (Egg and Cheese) if you want the best treats for your pet.</span></p>\n<p><span style=\"font-weight: 400;\">Perfect as training rewards, these bite-sized treats are made from fresh ingredients. The treat includes eggs which is an excellent source of protein, amino acids, fatty acids and vitamins. Made with cheese, the treat contains protein, calcium, vitamins and essential fatty acids. These treats are oven baked and have no added sugar or artificial flavours. </span></p>\n<p><b>Features:</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Made from real egg and cheese</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Free of artificial flavours</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Oven baked treats</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Eggs are an excellent source of protein, amino acids, fatty acids and vitamins</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Cheese provides protein, calcium, vitamins and essential fatty acids</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Enhances skin and coat health</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Made with human grade ingredients</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Suitable for dogs above 8 weeks of age</span></li>\n</ul>\n<p><b><i>HUFT Tip:</i></b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Always feed your dog the recommended quantity only</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Please refer to the packaging for possible allergens</span></li>\n<li style=\"font-weight: 400;\"><b><i><span style=\"font-weight: 400;\">These treats are great for mental stimulation of your dog! You can hide them and encourage your dog to find them, or use them in our interactive dog toys like </span><strong><a href=\"https://headsupfortails.com/pages/search-results-page?q=snuffle+mats\">Snuffle Mats</a></strong><span style=\"font-weight: 400;\"> for more fun.</span></i></b></li>\n</ul>\n<p><b>Storage instructions:</b></p>\n<ul>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Store in a cool, dry place, away from sunlight</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Do not consume if the seal is broken</span></li>\n</ul>\n<ul></ul>\n<ul data-mce-fragment=\"1\"></ul>",
