  "title": "HUFT Goat Milk Dog Cookies - Grilled Chicken - 200 g",
  "handle": "non-veg-goat-milk-dog-cookies",
  "description": "<p><span style=\"font-weight: 400;\">Treat your furry friend to the magic of goat milk cookies - packed with nutrition and goodness.</span></p>\n<p><span style=\"font-weight: 400;\">Gluten-free and all-natural, these wholesome cookies are made of 100% real ingredients that are hand-baked in small batches to retain the nutrients. </span><i><span style=\"font-weight: 400;\">What makes it so healthy</span></i><span style=\"font-weight: 400;\">, you ask? Goat milk is a superfood high in probiotics, protein, vitamins and fibre. All the same, chicken is power-packed with protein for that extra boost of energy and omega-6 fatty acids for healthy coat and skin. The cookies are also gluten-free which makes them easy to digest and suitable for all dogs.</span></p>\n<p><span style=\"font-weight: 400;\">Also perfect for gifting, the nutrient-rich cookies come in a reusable tin jar.</span></p>\n<p><b>Storage:</b></p>\n<p><span style=\"font-weight: 400;\">Once the packet is opened, store the cookies in the airtight container. Keep away from direct sunlight.</span></p>\n<p><b>Please refer to the feeding guidelines to avoid overfeeding:</b></p>\n<p><span style=\"font-weight: 400;\">Small Breed: 1-2 cookies/day</span></p>\n<p><span style=\"font-weight: 400;\">Medium Breed: 3-4 cookies/day</span></p>\n<p><span style=\"font-weight: 400;\">Large Breed: 4-5 cookies/day</span></p>\n<p><b>Features:</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Nutrient-rich superfood dog treats</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Made with real grilled chicken and goat milk</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Hand-baked in small batches</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Gluten-Free</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Goat Milk: High in probiotics, protein, vitamins and fibre</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Grilled Chicken: Power-packed with protein and omega-6 fatty acids</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Comes in a reusable tin jar</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Contains natural preservatives</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">No added colours</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Suitable for all breeds of dogs</span></li>\n</ul>\n<p><b>HUFT Tip:</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Always feed treats in moderation</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Always check ingredients for possible allergens</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">We recommend pet parental supervision while feeding treats</span></li>\n</ul>\n<ul></ul>\n<ul></ul>\n<ul></ul>\n<ul></ul>\n<ul></ul>\n<ul></ul>\n<ul></ul>\n<ul data-mce-fragment=\"1\"></ul>",
