  "description": "<p><span style=\"font-weight: 400;\">Taste meets health in our Yummy In My Tummy </span><span style=\"font-weight: 400;\">dog biscuits</span><span style=\"font-weight: 400;\">. Filled with the goodness of fresh, human grade chicken liver</span><span style=\"font-weight: 400;\"></span><span style=\"font-weight: 400;\">these are rich in protein, calcium and vitamins, and are perfect as treats or rewards during training. Oven-baked for easy digestion, healthy and bite-sized for convenience, these are free of artificial flavours; thus making them suitable for all dogs!</span></p>\n<p><b>Features:</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Made With Real Chicken Liver</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Free of Artificial Flavours</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Oven-Baked For Easy Digestion</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Rich In Protein, Iron &amp; Vitamins</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Human Grade Ingredients</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Suitable For Puppies Above 8 Weeks of Age</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Healthy, Delicious &amp; Safe To Eat</span></li>\n</ul>\n<p><b><i>HUFT Tip:</i></b></p>\n<ul>\n<li style=\"font-weight: 400;\">\n<span style=\"font-weight: 400;\">These </span><span style=\"font-weight: 400;\">dog treats</span><span style=\"font-weight: 400;\"> are great for mental stimulation games! You can hide these and encourage your dog to find them, or use them in our </span><span style=\"font-weight: 400;\">interactive dog toys</span><span style=\"font-weight: 400;\"> like </span><a href=\"https://headsupfortails.com/pages/search-results-page?q=snuffle+mats\"><span style=\"font-weight: 400;\">Snuffle Mats</span></a><span style=\"font-weight: 400;\"> for more fun!</span>\n</li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Always feed your dog the recommended quantity only</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Please refer to the packaging for possible allergens</span></li>\n</ul>\n<p><b>Storage instructions:</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Store in a cool, dry place away from direct sunlight</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Not to be consumed if the seal is broken</span></li>\n</ul>\n<ul></ul>\n<ul data-mce-fragment=\"1\"></ul>",
