  "handle": "huft-yimt-fish-sweet-potato-dog-biscuits",
  "description": "<p><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Looking for a treat which is the perfect blend of taste and health? Try HUFT Yummy In My Tummy (Fish and Sweet Potato).</span></p>\n<p><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Perfect as training rewards, these bite-sized treats are made from fresh ingredients. The Mackerel fish used in the treat makes it rich in omega 3 and is a great source of protein &amp; vitamins. Made with sweet potato, this treat is packed with vitamins, potassium, calcium and iron. These treats are oven baked and have no added sugar or artificial flavours.</span></p>\n<p><b>The best part?</b></p>\n<p><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Fish and sweet potato are hypoallergenic, making these treats a great alternative for pets with allergies.</span></p>\n<p><b>Features:</b></p>\n<ul>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Made from Mackerel fish and sweet potato</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Free of artificial flavours and sugar</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Oven baked treats</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Fish is rich in omega 3, protein and vitamins</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Sweet potato is packed with vitamins, potassium, calcium and iron</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Helps with the growth and development</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Promotes healthy skin, coat, eyes and muscles</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Made with human grade ingredients</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Suitable for dogs above 8 weeks of age</span></li>\n</ul>\n<p><b><i>HUFT Tip:</i></b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Always feed your dog the recommended quantity only</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Please refer to the packaging for possible allergens</span></li>\n<li style=\"font-weight: 400;\"><b><i><span style=\"font-weight: 400;\">These treats are great for mental stimulation of your dog! You can hide them and encourage your dog to find them, or use them in our interactive dog toys like </span><strong><a href=\"https://headsupfortails.com/pages/search-results-page?q=snuffle+mats\">Snuffle Mats</a></strong><span style=\"font-weight: 400;\"> for more fun.</span></i></b></li>\n</ul>\n<p><b>Storage instructions:</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Store in a cool, dry place, away from sunlight</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Do not consume if the seal is broken</span></li>\n</ul>\n<ul></ul>\n<ul data-mce-fragment=\"1\"></ul>",
