  "title": "HUFT On The Dot Personalised Dog & Cat Mat",
  "handle": "huft-on-the-dot-personalised-dog-mat",
  "description": "<p>Thoughtfully designed, the HUFT On The Dot Personalised Pet Mat is as comfortable as it is convenient. Just roll it up to carry it on your shoulder (by strap given) to take it with you on holiday. Besides being able to lay it out on the floor, you can also spread it out on your bed or on the seat of your car. And what makes this mat even more special is that you can have your pet's name printed on it!</p>\n<p><strong>Features:</strong></p>\n<ul>\n<li style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">100% Polyester with an anti-skid base</span></li>\n<li><span>Light polyfil stuffing for softness</span></li>\n<li><span><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">Easy to roll, store</span>and carry</span></li>\n<li><span>Versatile use - can be spread out in the car, on the sofa or on the floor</span></li>\n<li><span>Size variants available</span></li>\n</ul>\n<p><b>Care instructions:</b></p>\n<ul>\n<li><span>Machine wash separately at a gentle cycle using a mild detergent and cold water</span></li>\n<li><span>Do not bleach</span></li>\n<li><span>Dry flat in shade</span></li>\n<li><span>Steam iron, if needed</span></li>\n<li><span>Do not wring</span></li>\n</ul>\n<p><strong>How to Personalise:<br></strong>To personalise this mat, please add your pet's name in the field - \"Name\". </p>\n<p><strong>Please Note: </strong>The actual product might differ slightly from the one represented in the image. Colors and patterns may appear different due to different lighting conditions and based on the screen resolutions being used.</p>",
