  "description": "<p><span style=\"font-weight: 400;\">For pets that need a little extra love, this orthopedic bed promises to be their caring  slumber buddy.</span></p>\n<p><span style=\"font-weight: 400;\">Made with a self-adjusting and firm foam, the orthopedic mattress provides optimum back support. Comes with a detachable cushion for added neck support. It is designed for pets suffering from joint pains, arthritis, back/spinal problems and anxiety. It also works as a great aid for senior dogs.</span></p>\n<p><span style=\"font-weight: 400;\">More for you: the anti-skid bottom keeps it securely in place, preventing floor scratches. Plus, the removable zip-up cover makes cleaning a breeze.</span></p>\n<p><b>What makes our orthopedic mattress special?</b></p>\n<p><span style=\"font-weight: 400;\">The core layer is made of resin-bonded foam that provides maximum back support and maintains the natural curvature of the body. The thin bottom padding is the last layer, enforcing the entire structure. The mattress has a hard surface on one side and a softer one on the other side. Hence, it is reversible and can be used as per your dog's need.</span></p>\n<p><b>Built for dreams to remember:</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Self-adjusting, firm foam mattress</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Provides optimum back support</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Comes with a removable cushion for added neck support</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Ideal for dogs dealing with arthritis, joint pains, back/spinal problems</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Reversible mattress with a hard and soft side</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Eases stress, nervousness and anxiety</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Handle in the centre for easy bed movement</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Removable cover with zip closure for easy cleaning</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Anti-skid base</span></li>\n</ul>\n<p><b>Care Instructions:</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Cover can be gentle washed, with a mild detergent</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">hand wash is recommended</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Do not bleach</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Do not wring</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Hang dry in shade</span></li>\n</ul>\n<p><b>Note:</b><span style=\"font-weight: 400;\"> This is a made-to-order product. A longer shipping duration should be expected.</span><br></p>\n<ul></ul>",
