  "description": "<p>When you need a cushion of your own for a peaceful nap, why should your doggie be left behind? Designed exclusively for your four-legged-baby, it is shaped like a bone with soft Eco-Friendly (filled with fibre made with recycled PET bottles) inside for loads of comfort n bounce.</p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>Made of skin friendly, soft durable 100% Polyester canvas</li>\n<li>Attractive coloured piping on the sides to highlight the bone shape</li>\n<li>Elastic band at the back to secure it around the bed</li>\n</ul>\n<div data-mce-fragment=\"1\"><strong></strong></div>\n<p><strong>How To P</strong><b>ersonalise: </b>To personalise this cushion, please add your pet's name in the field - \"Enter Text\".</p>\n<div data-mce-fragment=\"1\">\n<strong>Dimensions:</strong><span> </span>16 in/40 cm X 10 in/ 25 cm.<br>\n</div>\n<div data-mce-fragment=\"1\"></div>\n<p><strong>HUFT Tip:</strong> Personalised items cannot be returned.</p>",
