  "description": "<p><i><span style=\"font-weight: 400;\">Long winter nights made warm and cosy, so your furry one can dream in comfort.</span></i></p>\n<p><span style=\"font-weight: 400;\">It's time to sit down and curl up for some wag-worthy dreams with HUFT Quilted Basket Pet Bed. The quilted cotton fabric with a removable centre cushion makes the bed cosy and versatile. You can use the cushion with the bed or separately as a mat for your pet. The side walls make your pet feel safe and sheltered from the cold. To ensure that they sleep uninterrupted, the base of the bed is anti-skid which keeps the bed securely in place, preventing floor scratches.</span></p>\n<p><b>Built for dreams to remember:</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Outer cover made of quilted cotton</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">A firm foam base</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Side walls to shelter from the cold</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Anti-skid base</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Removable and easy-to-wash centre cushion</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Versatile: cushion can be used with bed or separately as a mat</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Quilted for extra comfort</span></li>\n</ul>\n<p><b>Care Instructions:</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Spot cleaning or hand washing is recommended for the bed</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Machine wash the cushion cover with a mild detergent</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Do not bleach or tumble-dry</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Hang dry in shade</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Steam iron, if required</span></li>\n</ul>\n<ul></ul>\n<ul></ul>\n<ul></ul>\n<ul></ul>",
