  "description": "<p><span style=\"font-weight: 400;\">Unlimited naps guaranteed, with our Royal Snooze Bed The cover is 100% cotton and removable, thus making it comfortable and easy to clean. It is also antimicrobial, waterproof, stain-resistant and moisture-resistant, making it last up to 10 washes. The filling is innovative cool gel memory foam so that your dog can literally keep his/her cool. Scientifically constructed for optimum support, this long-lasting bed is also durable and temperature-controlled with a hygienic sleeping surface, making it convenient and comfortable. The bed also comes with a cushion with Best Dog Ever embroidered on it, because your best friend is exactly that.</span></p>\n<p data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">Features:</strong></p>\n<ul data-mce-fragment=\"1\">\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">100% Cotton cover</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">The fabric repels water, dirt and hair</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Breathable and comfortable</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Antimicrobial, stain-resistant &amp; moisture-resistant</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Innovative cool gel memory foam</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Scientifically constructed for optimum support</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Temperature-controlled, ventilated and hygienic sleeping surface</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Durable and long-lasting</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Available in different sizes</span></li>\n</ul>\n<p data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">Care Instructions: </strong>The bed cover is removable and can be machine washed at a gentle cycle of 30 degrees Celsius. Steam iron. Dry flat and do not bleach.</p>",
