  "description": "<p><i><span style=\"font-weight: 400;\">Shower your doggie with flowers for those lazy afternoon hours.</span></i></p>\n<p><span style=\"font-weight: 400;\">Crafted from durable poly canvas fabric and padded with polyfill stuffing, this mat provides a soft space for your dog to lounge, nap and play. The anti-skid base keeps the mat in place while your dog moves around. This mat folds up with velcro closures for compact storage and it has a handle that makes it travel-friendly.</span></p>\n<p><span style=\"font-weight: 400;\">Give your furry friend a slice of floral paradise with cushioned comfort for their paws!</span></p>\n<p><b>Why this mat MAT-TERS:</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Fabric: Poly canvas fabric with an anti-skid base</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Sturdy webbing handle</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Soft polyfill padding for more comfort </span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Velcro at the back for easy folding</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Portable and travel-friendly</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Available in 4 different sizes</span></li>\n</ul>\n<p><b>Wash Care:</b></p>\n<p><i><span style=\"font-weight: 400;\">Caring for the mat is easy.</span></i></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Machine wash separately in cold water with a mild detergent</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Do not bleach, wring or tumble dry</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Stick the velcro before washing</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Dry flat in the shade</span></li>\n</ul>\n<ul></ul>\n<ul></ul>\n<ul></ul>\n<ul></ul>\n<ul></ul>",
