  "description": "<p><span style=\"font-weight: 400;\">No more </span><i><span style=\"font-weight: 400;\">ruff </span></i><span style=\"font-weight: 400;\">sofa days. Just cosy, comfy and stress-free ones!</span></p>\n<p><span style=\"font-weight: 400;\">Want to cuddle up with your doggie on the sofa, but afraid of the clean-up after? This sofa protector will make your experience hassle-free and one to remember! The removable cover with zip closure is super easy to clean. The lower panel can be folded to make a floor or sofa bed too. The anti-skid base keeps it in place. It's also paw-approved, as it's made of super soft and cosy fabric that will comfort your pet.</span></p>\n<p><b>Crafted for days to remember:</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Keeps furniture clean and shed-free</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Removable cover with zip closure for easy cleaning</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Foldable lower panel to use as a floor/sofa bed</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Anti-skid base</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Eases anxiety and tension</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Back and side bolsters aid neck and head support</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Made of super soft and cosy fabric</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Suitable for all breeds and ages</span></li>\n</ul>\n<p><b>Care Instructions:</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Hand wash in cold water is recommended</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Can be machine washed separately in delicate wash setting</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Remove the bolster before washing</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Keep the zip cover closed while washing</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Do not bleach</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Line dry</span></li>\n</ul>\n<p><b>Note:</b><span style=\"font-weight: 400;\"> This is a made-to-order product. A longer shipping duration should be expected.</span><br></p>\n<ul></ul>",
