  "description": "<p><span style=\"font-weight: 400;\">Winter afternoons call for some lazy lounging in HUFT Fluffy Dreams Plush Mat.</span></p>\n<p><span style=\"font-weight: 400;\">Made of fur and a foam base that is softer than clouds, the mat has polyfill bolsters to provide neck comfort. Its luxurious faux fur mimics that of their mother, reducing nervous tension and providing maximum comfort. This is especially for pets who tend to get nervous quickly or frequently. The anti-skid bottom of the bed keeps it securely in place, preventing floor scratches.</span></p>\n<p><b>Designed for naps to remember:</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Fur-covered shell and anti-skid base</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Soft polyfill bolsters with foam filled centre</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Reduces nervous tension and eases anxiety</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Bolsters on all four sides for maximum neck comfort</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Easy to wash</span></li>\n</ul>\n<p><b>Care Instructions:</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Hand wash is recommended</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Can be washed in a gentle machine cycle with a mild detergent</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Do not bleach or tumble dry</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Hang dry in shade</span></li>\n</ul>\n<ul></ul>\n<ul data-mce-fragment=\"1\"></ul>",
