  "description": "<p data-mce-fragment=\"1\"><i data-mce-fragment=\"1\"><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">Everybody needs a deep cleanse sometimes—even your dog!</span></i></p>\n<p data-mce-fragment=\"1\"><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">When your dog lives their best life playing outdoors, a little grime and odour is natural. The HUFT Charcoal Natural Shampoo helps keep them clean and ready for more adventures! This plant-based formula is pH balanced and completely free of sulphates, parabens and toxic soaps. This means it’s gentle on their skin and tough on the toxins. It contains coconut-based activated charcoal that acts like a magnet to draw out impurities and odour. The shampoo is a unique blend of natural wheat germ oil, aloe vera and D Panthenol that hydrates, conditions, moisturizes and promotes hair growth at the roots. So, wash away the worries and say hello to soft, healthy, naturally shiny coats!</span></p>\n<p data-mce-fragment=\"1\"><b data-mce-fragment=\"1\">Features:</b></p>\n<ul data-mce-fragment=\"1\">\n<li style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">Natural, plant-based formula.</span></li>\n<li style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">Sulphate, soap and paraben-free.</span></li>\n<li style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">Optimally pH-balanced.</span></li>\n<li style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">Deep cleansing of the skin and fur.</span></li>\n<li style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">\n<span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">Contains coconut-based </span><b data-mce-fragment=\"1\">activated charcoal</b><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">: absorbs impurities and deodorizes.</span>\n</li>\n<li style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">\n<span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">Contains </span><b data-mce-fragment=\"1\">D Panthenol</b><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">: repairs and deeply hydrates the fur, enhancing natural shine.</span>\n</li>\n<li style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">\n<span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">Contains </span><b data-mce-fragment=\"1\">aloe vera</b><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">: conditions and moisturizes the skin.</span>\n</li>\n<li style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">\n<span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">Contains </span><b data-mce-fragment=\"1\">wheat germ oil</b><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">: treats frizzy and brittle hair, promotes hair growth.</span>\n</li>\n</ul>\n<b data-mce-fragment=\"1\">Directions for use: </b><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">Wet the coat and massage the shampoo to create lather. Rinse thoroughly. Gently dry the coat to prevent any damage to the fur. Be sure to protect your pet’s eyes and ears throughout the bath.</span>",
