  "handle": "huft-biodegradable-pet-wipes",
  "description": "<p><span style=\"font-weight: 400;\">Convenient, easy to use and completely biodegradable </span><span style=\"font-weight: 400;\"></span><span style=\"font-weight: 400;\">the HUFT Pet Wipes are a daily must-have! Created using a plant-based formula, you can use them for a quick wipe after walks for the paws or even the whole body.</span></p>\n<p><b>Here What Makes It A Good Buy</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Made From Plant-Based Ingredients: Aloe Vera Extracts, Cucumber Extracts &amp; Chamomile Extracts</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Earth-Friendly: All-Natural &amp; Completely Biodegradable</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">100% Pollution-Free: Made From Virgin, Non-Woven Spunlace Fabric</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Extra-Moist, Alcohol-Free &amp; Non-Irritating</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Easy To Use &amp; Dispose Of</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Made In India, With Love</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Available in 2 Sizes</span></li>\n</ul>\n<p><b>Benefits:</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Can Be Used On Your Pet Face, Paws &amp; Body</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Gentle On Your Pet Skin</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Safe To Use On Puppies &amp; Kittens</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Quick Clean-Up</span></li>\n</ul>\n<p><span style=\"font-weight: 400;\"><strong>Dimensions:</strong> 20 X 15 cm (each pet wipes).</span></p>\n<p><b>HUFT Tip: </b>Don't flush these down the toilet as this may clog the sewage pipelines. These wipes should be discarded as dry waste after use.</p>\n<ul></ul>\n<ul></ul>",
