  "handle": "huft-4-in-1-shampoo-conditioner-for-dogs",
  "description": "<p data-mce-fragment=\"1\"><i data-mce-fragment=\"1\"><span data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Experience the joy of convenience, times four!</span></i></p>\n<p data-mce-fragment=\"1\"><span data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">The HUFT 4-in-1 Shampoo &amp; Conditioner is a magical solution for making bath times easy-peasy. This plant-based formula is pH balanced and completely free of sulphates, parabens and toxic soaps. This means it gently </span><b data-mce-fragment=\"1\">cleanses</b><span data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">, </span><b data-mce-fragment=\"1\">conditions</b><span data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">, </span><b data-mce-fragment=\"1\">detangles </b><span data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">and </span><b data-mce-fragment=\"1\">moisturizes </b><span data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">the coat, while preserving their skin of natural oils. The shampoo is a unique blend of natural, Omega-3 and Vitamin E-rich olive oil, aloe vera, soy protein and wheat germ oil that deeply nourish, strengthen and enhance the hair quality. The soothing goodness of honeysuckle and chamomile are the cherry on top! So, say goodbye to complicated grooming routines, and hello to soft, healthy, naturally shiny coats!</span></p>\n<p data-mce-fragment=\"1\"><b data-mce-fragment=\"1\">Features:</b></p>\n<ul data-mce-fragment=\"1\">\n<li data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Natural, plant-based formula.</span></li>\n<li data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Sulphate, soap and paraben-free.</span></li>\n<li data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Optimally pH-balanced.</span></li>\n<li data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Gently cleanses, conditions, detangles and moisturizes the coat.</span></li>\n<li data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Soothing scents of honeysuckle and chamomile.</span></li>\n<li data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">\n<span data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Contains </span><b data-mce-fragment=\"1\">olive oil</b><span data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">: rich in Vitamin E and Omega-3 fatty acids that deeply nourish the skin and coat.</span>\n</li>\n<li data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">\n<span data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Contains </span><b data-mce-fragment=\"1\">aloe vera</b><span data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">: the most effective natural conditioner and moisturizer for the skin and coat, that enhances natural shine.</span>\n</li>\n<li data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">\n<span data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Contains </span><b data-mce-fragment=\"1\">soy protein and wheat germ oil</b><span data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">: strengthen hair at the roots, treat frizzy and brittle hair, promote hair growth.</span>\n</li>\n<li data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Makes DIY grooming convenient.</span></li>\n</ul>\n<b data-mce-fragment=\"1\">Directions for use: </b><span data-mce-fragment=\"1\" style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Wet the coat and massage the shampoo to create lather. Rinse thoroughly. Gently dry the coat to prevent any damage to the fur. Be sure to protect your pet's eyes and ears throughout the bath.</span>",
