  "handle": "barking-bloom-dog-perfume",
  "description": "<p data-mce-fragment=\"1\"><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">Love smells bloomin' good, especially with whom everyday is like a bouquet of blooms.</span></p>\n<p data-mce-fragment=\"1\"><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">Does your dog develop an odour after playing outdoors? It's natural! With HUFT Aqua Paws Dog Perfume, long-lasting freshness is just a spray away. Have your dog smell as sweet as carnations and jasmine, enchanting as lavender and zesty as bergamot. The pH balanced formula promises to be gentle on their skin, as it is crafted free of harmful sulphates and parabens. This makes it perfect for dogs who don't enjoy frequent baths, or when a full grooming session just isn't possible.</span></p>\n<p data-mce-fragment=\"1\"><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">It's pure love, in a bottle that's travel-friendly‚¬€so your pet is ready for every adventure anytime, anywhere!</span></p>\n<p data-mce-fragment=\"1\"><b data-mce-fragment=\"1\">How to use:</b></p>\n<ul data-mce-fragment=\"1\">\n<li style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">Spray a small amount and brush into your dog's coat</span></li>\n<li style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">Dab a little perfume behind their ears</span></li>\n<li style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">Spritz a bit focusing on the base of their tail</span></li>\n</ul>\n<p data-mce-fragment=\"1\"><b data-mce-fragment=\"1\">Ready for playdates, guests and everything in between:</b></p>\n<ul data-mce-fragment=\"1\">\n<li style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">Pleasant fragrance that doesn't bother their senses</span></li>\n<li style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">Sweet notes of carnations, jasmine, lavender &amp; bergamot</span></li>\n<li style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">Long-lasting fragrance</span></li>\n<li style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">pH balanced formula that is safe to use on skin</span></li>\n<li style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">Sulphate- and paraben-free</span></li>\n<li style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">Travel-friendly packaging</span></li>\n</ul>\n<p><b data-mce-fragment=\"1\">A word of caution: </b><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">The formulation is safe to use on your pet's skin in moderation. So, a little goes a long way. Make sure to spray away from your dog's face, nose, eyes and ears. If you notice an allergic reaction, seek immediate veterinary advice.</span></p>",
