  "handle": "huft-natural-itch-relief-oatmeal-shampoo-for-dogs-apple-cider-vinegar-aloe-vera",
  "description": "<p><span style=\"font-weight: 400;\">No more scratching that terrible itch, Our HUFT Itch Relief dog shampoo is an all-natural formula that been thoughtfully created for dogs with itchy skin. Colloidal oatmeal, apple cider vinegar, aloe vera and coconut milk all work together to relieve your dog from itchiness and inflammation while leaving a hydrated and moisturised skin behind. Formulated to restore their skin pH balance, this plant-based dog shampoo is also sulphate and paraben-free making it the perfect addition to your dog grooming routine.</span></p>\n<p><strong>Features:</strong></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Anti-itch dog shampoo</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">100% natural</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">pH-balanced formula</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Sulphate and paraben-free</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Made of colloidal oatmeal, apple cider vinegar, aloe vera and coconut milk</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Removes itchiness and inflammation</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Hydrates, soothes and moisturizes skin</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Soft and gentle on the skin</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Suitable for dogs 12 weeks and above</span></li>\n</ul>\n<p><strong>Directions for use</strong>:</p>\n<ul>\n<li>Wet the coat well and massage with the shampoo to create lather. Protect eyes and ears throughout the bath.</li>\n<li>Rinse the coat thoroughly to wash off shampoo.</li>\n<li>Dry the coat gently to avoid damaging the fur.</li>\n</ul>\n<br data-mce-fragment=\"1\">",
