  "description": "<p><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">Keeps your dog clean, without using water</span></p>\n<p><span style=\"font-weight: 400;\">Does your dog LOVE running in the mud but dislike getting baths? Then try our all-new HUFT Dry Shampoo for dogs.</span></p>\n<p><span style=\"font-weight: 400;\">Developed by our scientists at HUFT Innovation and Manufacturing Centre, this no rinse shampoo require</span><span style=\"font-weight: 400;\">s no bath to keep your companion clean. It's </span><span style=\"font-weight: 400;\">perfect for post-walk clean ups, in-between baths and your adventurous travels. </span><span style=\"font-weight: 400;\">All you've got to do is:</span></p>\n<ol>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Pump the foam in your hand and apply it on your dog's coat.</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Evenly distribute the foam on your pet's body</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Dry your pet's fur with a towel</span></li>\n</ol>\n<p><span style=\"font-weight: 400;\">This innovative grooming solution also keeps your dog away from chemicals, all thanks to its plant-based composition. It's </span><span style=\"font-weight: 400;\">made with natural actives for a fresh and cleaner coat. </span><span style=\"font-weight: 400;\">Organic Hemp Seed Oil heals dry and itchy skin while Green Tea Extract restores the coat's moisture and leaves a fresh scent behind.</span></p>\n<p><span style=\"font-weight: 400;\">So what are you waiting for? </span><span style=\"font-weight: 400;\">Pump up your dog's grooming today.</span></p>\n<p><b>Features:</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Easy to use dry shampoo for dogs</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Suitable for dogs over 12 weeks</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">No water needed</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">pH balanced</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Plant-based formulation</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Sulphate &amp; paraben free</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Use after walks &amp; in-between baths</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Travel-friendly</span></li>\n</ul>\n<p><b>Caution:</b></p>\n<p><span style=\"font-weight: 400;\">While applying the dry shampoo, avoid the eyes, ears and nose as it can cause irritation to your pet. If this occurs, flush your pet's eye for a couple of minutes with clean running water or with sterile saline (if available). If the irritation or redness persists, please consult your vet.</span></p>\n<ul></ul>",
