  "description": "<p>This plant-based shampoo is specially formulated for puppy and kitten coats. It works gently but effectively, to cleanse the skin and fur. Vanilla and Honey are used to keep the coat moisturised. Wheat germ Oil encourages the growth of healthy fur. This shampoo can also be used for adult dogs with sensitive skin.<br data-mce-fragment=\"1\"></p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>Plant based formula</li>\n<li>Can also be used for kittens and adults with sensitive skin</li>\n<li>With vanilla &amp; honey</li>\n<li>Also contains Wheat Germ oil</li>\n</ul>\n<p><strong>Ingredients: </strong>Plant derived and coconut based cleansers (ecocert approved), carbomer, glycerin, sodium benzoate, EDTA, water, aloe vera extract, almond oil, wheat germ oil, <br data-mce-fragment=\"1\">honey extract, Vanilla extract, fragrance.</p>\n<strong>Directions for use:</strong> Wet the coat well and massage shampoo in to create a lather. Protect the eyes and ears throughout the bath. Rinse the coat thoroughly to wash off shampoo. Dry the coat gently to avoid damaging the fur. <br data-mce-fragment=\"1\">",
