  "handle": "huft-narrow-tooth-comb-for-pets",
  "description": "<p data-mce-fragment=\"1\"><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">This comb for pets from HUFT is a great tool for everyday grooming. The narrowly spaced teeth are set so close that they can pick up ticks, eggs and any debris. The handle makes combing your pet easier, remember to be gentle when using this and mindful of any mats. Do not yank at mats, this will hurt your pet. It helps to work in sections.</span></p>\n<ul data-mce-fragment=\"1\">\n<li style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">Available in 2 sizes</span></li>\n<li style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">Dimensions (large): 22 x 4 cm</span></li>\n<li style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">Dimensions (small): 22 x 3 cm</span></li>\n<li style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">Stainless steel teeth</span></li>\n<li style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">Rubber handle offers a convenient grip</span></li>\n<li>Designed with smoothrounded edges which protects skin, helps prevent tangles &amp; remove dead and loose fur</li>\n<li>Helps increase blood circulation</li>\n<li>Suitable for sensitive parts like Face, Ears, Tail</li>\n<li>Should be used after removing all tangles</li>\n<li>Suitable for silky soft hair dogs (medium to long)</li>\n</ul>",
