  "id": 4764844556350,
  "title": "HUFT Natural Tick & Flea Repellent Shampoo for Dogs",
  "handle": "huft-natural-tick-flea-repellent-shampoo-for-dogs-and-cats-500-ml",
  "description": "<p>This plant-based formulation harnesses the power of natural tick and flea repellents so it is both effective and gentle on your pet's skin. It contains Lavender and Geranium essential oils in measured quantities. Aloe is helpful thanks to its moisturizing properties and Wheat Germ oil improves circulation while reducing inflammation.</p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>Anti-tick and flea formulation (plant-based)</li>\n<li>With Lavender &amp; Geranium essential oils</li>\n<li>Contains Aloe and Wheat Germ oil</li>\n</ul>\n<p><strong>Ingredients: </strong>Plant-derived and coconut based cleansers (ecocert, approved), carbomer, glycerin, sodium benzoate, EDTA, water chamomile extract, D-panthenol (Vitamin B-5), wheat germ oil, aloe vera extract, geranium essential oil, lavender essential oil.</p>\n<strong>Directions for use</strong>: Wet the coat well and massage shampoo in to create a lather. Protect the eyes and ears throughout the bath. Rinse the coat thoroughly to wash off shampoo. Dry the coat gently to avoid damaging the fur. <br data-mce-fragment=\"1\">",
