  "handle": "huft-sea-breeze-perfume-for-dogs",
  "description": "<p><span style=\"font-weight: 400;\">We are sure that your pet and you love it when they stay fresh every single day. Try the HUFT Perfume (Sea Breeze) in between baths to keep them fresh! Just spritz a little perfume on your pet and they are left smelling like a sea breeze. This fresh scent comes from natural essential oils and is safe to use as there is an absence of harsh chemicals, artificial fragrances, or parabens.</span></p>\n<p><b>Features</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Refreshing sea breeze scented perfume</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Made with natural essential oils‚¬Å¡¬€¦¡¬€š¬¦¡ </span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Consists cold pressed sweet almond oil</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">No harsh chemicals, artificial fragrances or parabens</span></li>\n</ul>\n<p><b>Directions for use</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Stroke well before use, spray 10-12 inches away from the coat</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Spray from the back of the head to the base of the tail in one sweeping motion</span></li>\n</ul>\n<p><b>HUFT Tip</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Please ensure that your pet does not lick the perfume</span></li>\n</ul>\n<ul></ul>\n<ul></ul>\n<ul></ul>",
