  "title": "HUFT Natural Deep Cleansing and Deodorising Shampoo for Dogs",
  "handle": "huft-natural-deorising-deep-clean-shampoo-for-dogs-and-cats-500-ml",
  "description": "<p align=\"justify\">This special shampoo is for those times when your doggie's fur needs a deep cleanse. Its formulation is plant-derived so, it's effective while being gentle on the coat and skin. It contains activated charcoal which removes dirt and odour. Wheat Germ Oil also improves circulation and encourages the growth of a healthy coat.</p>\n<p align=\"justify\"><strong>Features:</strong></p>\n<ul>\n<li>Deep cleansing plant-derived formula</li>\n<li>With activated charcoal and Wheat Germ oil</li>\n</ul>\n<p><b>Ingredients: </b>Plant derived and coconut based cleansers (ecocert approved), Carbomer, glycerin, sodium benzoate, EDTA, water, chamomile extract, D-panthenol (Vitamin B-5), wheat germ oil, aloe vera extract, coconut charcoal, fragrance.</p>\n<p align=\"justify\"><strong>Directions for use</strong>: Wet the coat well and massage shampoo in to create a lather. Protect the eyes and ears throughout the bath. Rinse the coat thoroughly to wash off shampoo. Dry the coat gently to avoid damaging the fur.</p>",
