  "title": "HUFT Deshedder with Rake for Dogs - Orange",
  "handle": "huft-deshedder-with-rake-for-dogs-orange",
  "description": "<p>HUFT Dog Deshedder with Rake - Orange. Use the deshedder side of this tool to work through the stubborn undercoat. The rake tool captures clumps of loose and dead hair. To shift from one to another, all you have to do is flip the top over!</p>\n<p><strong><span style=\"text-decoration: underline;\">Features</span>:</strong></p>\n<ul>\n<li>Combination tool for dogs</li>\n<li>Deshedder with rake tool</li>\n<li>Dimensions (large): 20 x 10 cm</li>\n<li>Dimensions(small): 21 x 8 cm</li>\n<li>To change over, simply flip the top</li>\n<li>Stainless steel teeth for durability</li>\n<li>Can be used to work up a lather during bath</li>\n<li>Rubber handle enables firm grip</li>\n<li>If you are unsure how to use this, seek the advice of a professional</li>\n</ul>\n<p><span style=\"text-decoration: underline;\"><strong>Breed suitability:</strong></span> Excellent for dogs with double coats and short coats like Labradors, Golden Retrievers, Huskies, German Shepherds and Pugs.</p>\n<p><strong>HUFT Tip:</strong> Comb in the direction of hair growth and away from the skin. Work on the coat in sections to make it easier. Remove tangles gently, do not pull on the fur too hard as it will hurt your dog.</p>",
