  "handle": "huft-double-sided-steel-comb-for-pets",
  "description": "<p>HUFT Double Sided Steel Dog Comb - Orange is great for capturing loose/shed fur and also, manages to pick up fleas (on the narrower side). At the end of the groom, a gentle combing distributes natural oils evenly across the coat.</p>\n<p><span style=\"text-decoration: underline;\"><strong>Features:</strong></span></p>\n<ul>\n<li>Double Sided Comb for dogs</li>\n<li>Dimensions: 21 x 7 cm</li>\n<li>Widespaced teeth help demat and detangle</li>\n<li>Narrow spaced teeth captures flea, flea debris and loose fur</li>\n<li>Helps detangle, de-mat</li>\n<li>Rubber handle for better grip</li>\n<li>Suitable for all medium and long haired breeds</li>\n</ul>\n<p><span></span><span></span>If you are unsure how to use this, seek the advice of a professional</p>\n<p><strong>HUFT Tip:</strong> Comb in the direction of hair growth and away from the skin. Work on the coat in sections to make it easier. Remove tangles gently, do not pull on the fur too hard as it will hurt your dog.</p>",
